import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

state = {
    unidentified: [],
    finalItem: ''
}

style = {
    overflow: 'scroll',
    height: '350px'
}

render(){

    setInterval(()=>{
        let newList = this.state.unidentified.map((e, i)=>{
            return <FeedItem key="i">ALECLAWLOR</FeedItem>
        })
        newList.push(<FeedItem>ALECLAWLOR</FeedItem>)
        this.setState({unidentified: newList, finalItem: newList.pop()})
    }, 5000)

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        {this.state.finalItem}
    </div>)}
}


export default unregisteredFeed
